import React from 'react';
import { Link } from 'react-router-dom';

const UrlList = ({ urls }) => {
  return (
    <div>
      <h2>URL List</h2>
      <ul>
        {urls.map((url) => (
          <li key={url._id}>
            <Link target="_blank" to={url.url} >mylink </Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default UrlList;
